import React from "react";

function Feedback() {
  return (
    <>
      <textarea
        className="textarea"
        rows="10"
        cols="50"
        placeholder="Enter your feedback"
      />
      <button type="submit" className="ticket-button" >
        Boot tickets
      </button>
    </>
  );
}

export default Feedback;
